import React from 'react'
import {Link} from "react-router-dom";


export default function Rooms({id, rooms}) {
    console.log({id})
    return (
        <Link to={`/rooms/${rooms.slug}`} key={id} style={{textDecoration:"none"}}>
        <div key={id} style={{backgroundImage:`url(${rooms.images[0]})`, backgroundSize:"cover"}} className="featured-rooms">
            <span style={{padding:0, margin:0, backrgoundColor:"black"}}><h6>{rooms.price}</h6></span>
            <h6>{rooms.name}</h6>

        </div>
        </Link>
    )
}
